//設定を反映する
function apply(){
	let tStylesId=["libertyStyle","coverStyle","imgStyle","imgData"]
	for(var tId of tStylesId){
		let tTag=document.getElementById(tId)
		gDb.update({_id:tId},{style:tTag.value},()=>{})
	}
}

//現在の設定を表示
function showCurrentStyle(){
	gDb=new nedb({
		filename: __dirname+"/../../database/database.db",
		autoload:true
	})
	gDb.find({},(e,doc)=>{
		for(var tData of doc){
			document.getElementById(tData._id).value=tData.style
		}
	})
}
//style初期化
function initStyle(){
	document.getElementById("libertyStyle").value="body{filter:invert(100%);}"
	document.getElementById("coverStyle").value="background-color:rgba(0,0,0,0.6);"
	document.getElementById("imgStyle").value=""
	document.getElementById("imgData").value=gImg
}

